import React from 'react';

const Menu4 = () => {
  return (
    <section className='menu'>
      <div className='menu3'>
        <h2 className='menu4h2'>
          Finding the best car insurance company for you
        </h2>
        <p>
          Pricing and discounts made up a portion of each insurer’s score, but
          we know that cost is the top factor for many auto insurance shoppers.
          Since pricing is based on personal factors including your age,
          location, vehicle and credit history and gender (in most cases), it’s
          important to shop around for car insurance quotes.
        </p>
        <p>
          If price is the most important factor in your search, comparing car
          insurance quotes can help you find the cheapest rate. But your
          shopping experience will also shed light on a company’s customer
          service standards.
        </p>
      </div>
    </section>
  );
};

export default Menu4;
